// ChildRegistrationForm.js
import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import './Registration.css'
import {Container, Nav, Navbar, Form, Button} from 'react-bootstrap';

const ChildRegistrationForm = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    age: '',
    gender: 'male',
    immunizations: 'BCG',
  });

  const handleInputChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleFormSubmit = (e) => {
    e.preventDefault();

    // Validate form data
    if (!formData.firstName || !formData.lastName || !formData.age) {
      alert('Please fill in all mandatory fields.');
      return;
    }

    // Save child to local storage
    const newChild = {
      id: Date.now(),
      ...formData,
    };

    const storedChildren = JSON.parse(localStorage.getItem('children')) || [];
    localStorage.setItem('children', JSON.stringify([...storedChildren, newChild]));

    // Clear the form
    setFormData({
      firstName: '',
      lastName: '',
      age: '',
      gender: 'male',
      immunizations: 'BCG',
    });

    // Navigate to the children list page
    navigate('/children-list');
  };

  return (



    <div className='container'>


      <h1>Child Registration Form</h1>
      {/* <form className='form' onSubmit={handleFormSubmit}>
        <div className="input-box">
        <label>
          First Name:
          <input type="text" name="firstName" value={formData.firstName} onChange={handleInputChange} required />
        </label>
        </div>

        <div className="input-box">
        <label>
          First Name:
          <input type="text" name="firstName" value={formData.firstName} onChange={handleInputChange} required />
        </label>
        </div>
        <div className="input-box">
        <label>
          Age:
          <input type="text" name="age" value={formData.age} onChange={handleInputChange} required />
        </label>
        </div>
        <div>
        <label>
          Gender:
          <select name="gender" value={formData.gender} onChange={handleInputChange}>
            <option value="male">Male</option>
            <option value="female">Female</option>
          </select>
        </label>
        </div>
        <div>
        <label>
          Immunizations:
          <select name="gender" value={formData.gender} onChange={handleInputChange}>
            <option value="BCG">BCG</option>
            <option value="MMR">MMR</option>
            <option value="RV">RV</option>
            <option value="DTaP">DTaP</option>
          </select>
        </label>
        </div>
        <button type="submit" id='summit-buton'>Register Child</button>
      </form> */}



<Form className='form' onSubmit={handleFormSubmit}>
      {/* <Form.Group className="mb-3" controlId="formBasicEmail">
        <Form.Label>First name</Form.Label>
        <Form.Control type="text" placeholder="First name" value={formData.firstName} onChange={handleInputChange} />
      </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicPassword">
        <Form.Label>Last name</Form.Label>
        <Form.Control type="text" placeholder="Fast Name" value={formData.lastName} onChange={handleInputChange} />
      </Form.Group> */}


      <Form.Group className="mb-3" controlId="formBasicPassword" value={formData.age} onChange={handleInputChange}>
              <Form.Label>first name</Form.Label>
              <Form.Control type="text" placeholder="Age" />
            </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicPassword" value={formData.age} onChange={handleInputChange}>
              <Form.Label>Age</Form.Label>
              <Form.Control type="text" placeholder="Age" />
            </Form.Group>


      <Form.Group className="mb-3" controlId="formBasicPassword" value={formData.age} onChange={handleInputChange}>
        <Form.Label>Age</Form.Label>
        <Form.Control type="text" placeholder="Age" />
      </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicCheckbox" value={formData.gender} onChange={handleInputChange}>
        <Form.Select aria-label="Default select example">
          <option value="Male">Male</option>
          <option value="Female">Female</option>
        </Form.Select>
      </Form.Group>

      <Form.Group className="mb-3" controlId="formBasicCheckbox" value={formData.immunizations} onChange={handleInputChange}>
        <Form.Select aria-label="Default select example">
          <option value="BCG">BCG</option>
          <option value="MMR">MMR</option>
          <option value="DTaP">DTap</option>
          <option value="RV">RV</option>
        </Form.Select>
      </Form.Group>

      <Button variant="primary" type="submit">
        Submit
      </Button>
    </Form>


    </div>
  );
};

export default ChildRegistrationForm;
